import React, { useState } from "react";

const EduItem = ({ education }) => {
  const [showDetails, setShowDetails] = useState(false);

  return (
    <div className="edu-item" onClick={() => setShowDetails(!showDetails)}>
      <div className="edu-title">{education.title}</div>
      {showDetails ? (
        <div className="edu-details">
          <div className="edu-who">{education.forWho}</div>
          <div className="edu-location">{education.location}</div>
          <div className="edu-start">{education.start}</div>
          <div className="edu-end">{education.end}</div>
          <div className="edu-courses">{education.courses}</div>
          <div className="edu-description">{education.description}</div>
        </div>
      ) : null}
    </div>
  );
};

export default EduItem;
